      \u0275\u0275text(53, " \u0421\u0435\u0440\u0432\u0456\u0441 \u043C\u043E\u0436\u0435 \u043C\u0456\u0441\u0442\u0438\u0442\u0438 \u043F\u043E\u0441\u0438\u043B\u0430\u043D\u043D\u044F \u043D\u0430 \u0441\u0430\u0439\u0442\u0438, \u0456\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u0438 \u0447\u0438 \u0440\u0435\u0441\u0443\u0440\u0441\u0438 \u0442\u0440\u0435\u0442\u0456\u0445 \u0441\u0442\u043E\u0440\u0456\u043D. \u041C\u0438 \u043D\u0435 \u043A\u043E\u043D\u0442\u0440\u043E\u043B\u044E\u0454\u043C\u043E \u0457\u0445 \u0456 \u043D\u0435 \u043D\u0435\u0441\u0435\u043C\u043E \u0432\u0456\u0434\u043F\u043E\u0432\u0456\u0434\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0456 \u0437\u0430 \u0457\u0445\u043D\u0456\u0439 \u0437\u043C\u0456\u0441\u0442 \u0430\u0431\u043E \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u0456\u0441\u0442\u044C. ");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(54, "p", 4);
      \u0275\u0275text(55, " \u0412\u0430\u0448\u0435 \u043A\u043E\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430\u043A\u0438\u043C\u0438 \u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0456\u043C\u0438 \u0441\u0435\u0440\u0432\u0456\u0441\u0430\u043C\u0438 \u0437\u0434\u0456\u0439\u0441\u043D\u044E\u0454\u0442\u044C\u0441\u044F \u043D\u0430 \u0432\u0430\u0448 \u0432\u043B\u0430\u0441\u043D\u0438\u0439 \u0440\u0438\u0437\u0438\u043A \u0456 \u0437\u0430 \u0443\u043C\u043E\u0432\u0438 \u0434\u043E\u0442\u0440\u0438\u043C\u0430\u043D\u043D\u044F \u0457\u0445\u043D\u0456\u0445 \u043F\u0440\u0430\u0432\u0438\u043B. ");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(56, "article", 2)(57, "h3", 3);
      \u0275\u0275text(58, "6. \u0412\u0456\u0434\u043C\u043E\u0432\u0430 \u0432\u0456\u0434 \u0433\u0430\u0440\u0430\u043D\u0442\u0456\u0439 \u0442\u0430 \u043E\u0431\u043C\u0435\u0436\u0435\u043D\u043D\u044F \u0432\u0456\u0434\u043F\u043E\u0432\u0456\u0434\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0456");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(59, "p", 4);
      \u0275\u0275text(60, " \u0421\u0435\u0440\u0432\u0456\u0441 \u0442\u0430 \u0432\u0441\u0456 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0438 \u043D\u0430\u0434\u0430\u044E\u0442\u044C\u0441\u044F \xAB\u044F\u043A \u0454\xBB \u0456 \xAB\u0437 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u0456\u0441\u0442\u044E\xBB, \u0431\u0435\u0437 \u0431\u0443\u0434\u044C-\u044F\u043A\u0438\u0445 \u0433\u0430\u0440\u0430\u043D\u0442\u0456\u0439, \u044F\u0432\u043D\u0438\u0445 \u0430\u0431\u043E \u043F\u0440\u0438\u0445\u043E\u0432\u0430\u043D\u0438\u0445. ");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(61, "p", 4);
      \u0275\u0275text(62, " \u041C\u0438 \u043D\u0435 \u0433\u0430\u0440\u0430\u043D\u0442\u0443\u0454\u043C\u043E, \u0449\u043E \u0421\u0435\u0440\u0432\u0456\u0441 \u0431\u0443\u0434\u0435 \u0431\u0435\u0437\u043F\u0435\u0440\u0435\u0440\u0432\u043D\u0438\u043C, \u0431\u0435\u0437\u043F\u0435\u0447\u043D\u0438\u043C \u0430\u0431\u043E \u0431\u0435\u0437\u043F\u043E\u043C\u0438\u043B\u043A\u043E\u0432\u0438\u043C. ");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(63, "p", 4);
      \u0275\u0275text(64, " \u0412 \u043C\u0435\u0436\u0430\u0445, \u0434\u043E\u0437\u0432\u043E\u043B\u0435\u043D\u0438\u0445 \u0437\u0430\u043A\u043E\u043D\u043E\u043C, \u043C\u0438 \u0442\u0430 \u043D\u0430\u0448\u0456 \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u0438 \u043D\u0435 \u043D\u0435\u0441\u0435\u043C\u043E \u0432\u0456\u0434\u043F\u043E\u0432\u0456\u0434\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0456 \u0437\u0430 \u0431\u0443\u0434\u044C-\u044F\u043A\u0456 \u043D\u0435\u043F\u0440\u044F\u043C\u0456, \u0432\u0438\u043F\u0430\u0434\u043A\u043E\u0432\u0456, \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u0430\u0431\u043E \u043D\u0430\u0441\u043B\u0456\u0434\u043A\u043E\u0432\u0456 \u0437\u0431\u0438\u0442\u043A\u0438, \u0432\u0442\u0440\u0430\u0442\u0438 \u0447\u0438 \u0432\u0438\u0442\u0440\u0430\u0442\u0438 (\u0432\u043A\u043B\u044E\u0447\u043D\u043E \u0437 \u0432\u0442\u0440\u0430\u0442\u043E\u044E \u0434\u0430\u043D\u0438\u0445, \u043F\u0440\u0438\u0431\u0443\u0442\u043A\u0456\u0432 \u0447\u0438 \u0431\u0456\u0437\u043D\u0435\u0441\u0443), \u0449\u043E \u0432\u0438\u043D\u0438\u043A\u043B\u0438 \u0437 \u0430\u0431\u043E \u0443 \u0437\u0432'\u044F\u0437\u043A\u0443 \u0437 \u0432\u0430\u0448\u0438\u043C \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u044F\u043C \u0421\u0435\u0440\u0432\u0456\u0441\u0443. ");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(65, "article", 2)(66, "h3", 3);
      \u0275\u0275text(67, "7. \u0417\u043C\u0456\u043D\u0438 \u0434\u043E \u0423\u043C\u043E\u0432");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(68, "p", 4);
      \u0275\u0275text(69, " \u041C\u0438 \u043C\u043E\u0436\u0435\u043C\u043E \u0437\u043C\u0456\u043D\u044E\u0432\u0430\u0442\u0438 \u0446\u0456 \u0423\u043C\u043E\u0432\u0438 \u0432 \u0431\u0443\u0434\u044C-\u044F\u043A\u0438\u0439 \u0447\u0430\u0441, \u043F\u0443\u0431\u043B\u0456\u043A\u0443\u044E\u0447\u0438 \u043E\u043D\u043E\u0432\u043B\u0435\u043D\u0443 \u0432\u0435\u0440\u0441\u0456\u044E \u043D\u0430 \u0421\u0435\u0440\u0432\u0456\u0441\u0456. \u041E\u043D\u043E\u0432\u043B\u0435\u043D\u0430 \u0432\u0435\u0440\u0441\u0456\u044F \u043D\u0430\u0431\u0443\u0432\u0430\u0454 \u0447\u0438\u043D\u043D\u043E\u0441\u0442\u0456 \u043D\u0435\u0433\u0430\u0439\u043D\u043E \u043F\u0456\u0441\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u043A\u0430\u0446\u0456\u0457. \u0412\u0438 \u043D\u0435\u0441\u0435\u0442\u0435 \u0432\u0456\u0434\u043F\u043E\u0432\u0456\u0434\u0430\u043B\u044C\u043D\u0456\u0441\u0442\u044C \u0437\u0430 \u043F\u0435\u0440\u0456\u043E\u0434\u0438\u0447\u043D\u0438\u0439 \u043F\u0435\u0440\u0435\u0433\u043B\u044F\u0434 \u0423\u043C\u043E\u0432. \u041F\u0440\u043E\u0434\u043E\u0432\u0436\u0435\u043D\u043D\u044F \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u044F \u0421\u0435\u0440\u0432\u0456\u0441\u0443 \u043F\u0456\u0441\u043B\u044F \u0437\u043C\u0456\u043D \u043E\u0437\u043D\u0430\u0447\u0430\u0454 \u0432\u0430\u0448\u0435 \u043F\u0440\u0438\u0439\u043D\u044F\u0442\u0442\u044F \u0446\u0438\u0445 \u0437\u043C\u0456\u043D. ");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(70, "article", 2)(71, "h3", 3);
      \u0275\u0275text(72, "8. \u0417\u0430\u0441\u0442\u043E\u0441\u043E\u0432\u043D\u0435 \u043F\u0440\u0430\u0432\u043E");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(73, "p", 4);
      \u0275\u0275text(74, " \u0426\u0456 \u0423\u043C\u043E\u0432\u0438 \u0440\u0435\u0433\u0443\u043B\u044E\u044E\u0442\u044C\u0441\u044F \u0442\u0430 \u0442\u043B\u0443\u043C\u0430\u0447\u0430\u0442\u044C\u0441\u044F \u0432\u0456\u0434\u043F\u043E\u0432\u0456\u0434\u043D\u043E \u0434\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u0423\u043A\u0440\u0430\u0457\u043D\u0438. \u0411\u0443\u0434\u044C-\u044F\u043A\u0456 \u0441\u043F\u043E\u0440\u0438, \u0449\u043E \u0432\u0438\u043D\u0438\u043A\u0430\u044E\u0442\u044C \u0437 \u0446\u0438\u0445 \u0423\u043C\u043E\u0432 \u0430\u0431\u043E \u0443 \u0437\u0432'\u044F\u0437\u043A\u0443 \u0437 \u043D\u0438\u043C\u0438, \u043F\u0456\u0434\u043B\u044F\u0433\u0430\u044E\u0442\u044C \u0432\u0438\u043A\u043B\u044E\u0447\u043D\u0456\u0439 \u044E\u0440\u0438\u0441\u0434\u0438\u043A\u0446\u0456\u0457 \u0441\u0443\u0434\u0456\u0432 \u0423\u043A\u0440\u0430\u0457\u043D\u0438. ");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(75, "article", 2)(76, "h3", 3);
      \u0275\u0275text(77, "9. \u0420\u043E\u0437\u0434\u0456\u043B\u044C\u043D\u0456\u0441\u0442\u044C \u0442\u0430 \u0432\u0435\u0441\u044C \u0434\u043E\u0433\u043E\u0432\u0456\u0440");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(78, "p", 4);
      \u0275\u0275text(79, " \u042F\u043A\u0449\u043E \u0431\u0443\u0434\u044C-\u044F\u043A\u0435 \u043F\u043E\u043B\u043E\u0436\u0435\u043D\u043D\u044F \u0446\u0438\u0445 \u0423\u043C\u043E\u0432 \u0432\u0438\u0437\u043D\u0430\u0454\u0442\u044C\u0441\u044F \u043D\u0435\u0434\u0456\u0439\u0441\u043D\u0438\u043C \u0430\u0431\u043E \u043D\u0435\u0432\u0438\u043A\u043E\u043D\u0443\u0432\u0430\u043D\u0438\u043C, \u0456\u043D\u0448\u0456 \u043F\u043E\u043B\u043E\u0436\u0435\u043D\u043D\u044F \u0437\u0430\u043B\u0438\u0448\u0430\u044E\u0442\u044C\u0441\u044F \u0432 \u043F\u043E\u0432\u043D\u0456\u0439 \u0447\u0438\u043D\u043D\u043E\u0441\u0442\u0456. \u0426\u0456 \u0423\u043C\u043E\u0432\u0438 \u0440\u0430\u0437\u043E\u043C \u0456\u0437 \u043D\u0430\u0448\u043E\u044E \u041F\u043E\u043B\u0456\u0442\u0438\u043A\u043E\u044E \u043A\u043E\u043D\u0444\u0456\u0434\u0435\u043D\u0446\u0456\u0439\u043D\u043E\u0441\u0442\u0456 \u0441\u0442\u0430\u043D\u043E\u0432\u043B\u044F\u0442\u044C \u043F\u043E\u0432\u043D\u0438\u0439 \u0434\u043E\u0433\u043E\u0432\u0456\u0440 \u043C\u0456\u0436 \u0432\u0430\u043C\u0438 \u0442\u0430 \u043D\u0430\u043C\u0438 \u0449\u043E\u0434\u043E \u0421\u0435\u0440\u0432\u0456\u0441\u0443. ");
      \u0275\u0275elementEnd()()();
