      \u0275\u0275text(158, "9. Severability and Entire Agreement");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(159, "p", 4);
      \u0275\u0275text(160, " If any provision of these Terms is found to be invalid or unenforceable, the remaining provisions remain in full force. These Terms together with our Privacy Policy constitute the entire agreement between you and us regarding the Service. ");
